import './c-dashboard.css'
function Calendly() {

    return (
        <div className="container-calendly">
            <br></br>
            <p className="s-font-header black">Calendly Link</p>
            <p className="s-font-main black">Participants will use this link to book time with you </p>
            <br></br>
            <button className="c-button black">Link your Calendly</button>
        </div>

    );
  }

  export default Calendly;
